import Modal from "../UI/Modal"
const Cart=(props)=>{
    const CartItems=(
        <ul>
            {
                [{id:'c1', name:'sushi', amount:2, price:19.99}].map((item)=>{
                    <li>{item.name}</li>
                })
            }
        </ul>
    )
    return(
        <Modal className='modal'>
          {CartItems}
          <div>
            <span>Total Amount</span>
            <span>35.44</span>
          </div>
          <div>
            <button>Close</button>
            <button>Order</button>
          </div>
         </Modal>
    )
}

export default Cart
